void linesos(instant_data_t* instant_data ,lavie_data_t *lavie_data)
{	
	instant_data_t *sq_data = NULL;  // for filter results and square results
 	sq_data = (instant_data_t *)pvPortMalloc(sizeof(instant_data_t)); 
	if(sq_data == NULL)
	{
		LOG_DEBUGF("Could not allocate memory :sq_data");
		Error_Handler();
	}
	
	float32_t *sum_data_bpf = NULL;  // for sum bfp results
 	sum_data_bpf = (float32_t *)pvPortMalloc(HEART_WINDOW*sizeof(float32_t)); 
	if(sum_data_bpf == NULL)
	{
		LOG_DEBUGF("Could not allocate memory :sum_data_bpf");
		Error_Handler();
	}

	filter_data(BPF_0P7_20, instant_data->x1, sq_data->x1, HEART_WINDOW);
	filter_data(BPF_0P7_20, instant_data->y1, sq_data->y1, HEART_WINDOW);
	filter_data(BPF_0P7_20, instant_data->z1, sq_data->z1, HEART_WINDOW);
#ifdef PAD_3_SENSOR
	filter_data(BPF_0P7_20, instant_data->x2, sq_data->x2, HEART_WINDOW);
	filter_data(BPF_0P7_20, instant_data->y2, sq_data->y2, HEART_WINDOW);
	filter_data(BPF_0P7_20, instant_data->z2, sq_data->z2, HEART_WINDOW);
	filter_data(BPF_0P7_20, instant_data->x3, sq_data->x3, HEART_WINDOW);
	filter_data(BPF_0P7_20, instant_data->y3, sq_data->y3, HEART_WINDOW);
	filter_data(BPF_0P7_20, instant_data->z3, sq_data->z3, HEART_WINDOW);
#endif

	for(uint16_t i = 0; i < HEART_WINDOW; i++)
	{
#ifdef PAD_3_SENSOR
		sum_data_bpf[i] = sq_data->x1[i] + sq_data->y1[i] + sq_data->z1[i] + sq_data->x2[i] + sq_data->y2[i] + sq_data->z2[i] + sq_data->x3[i] + sq_data->y3[i] + sq_data->z3[i];
#else
		sum_data_bpf[i] = sq_data->x1[i] + sq_data->y1[i] + sq_data->z1[i];
#endif
		sq_data->x1[i] = sq_data->x1[i]*sq_data->x1[i];
		sq_data->y1[i] = sq_data->y1[i]*sq_data->y1[i];
		sq_data->z1[i] = sq_data->z1[i]*sq_data->z1[i];
#ifdef PAD_3_SENSOR
		sq_data->x2[i] = sq_data->x2[i]*sq_data->x2[i];
		sq_data->y2[i] = sq_data->y2[i]*sq_data->y2[i];
		sq_data->z2[i] = sq_data->z2[i]*sq_data->z2[i];
		sq_data->x3[i] = sq_data->x3[i]*sq_data->x3[i];
		sq_data->y3[i] = sq_data->y3[i]*sq_data->y3[i];
		sq_data->z3[i] = sq_data->z3[i]*sq_data->z3[i];
#endif
	}

	//Call search_movements function for 4-second data (data after BPF)	
	movements_t movements[MAX_MOV_5s_NUM] = {0};	
	float32_t avg_energy_out = 0;   //this value will need to be adjusted later
	uint8_t num_moves = search_movements(sum_data_bpf, HEART_WINDOW, 1.5*avg_energy_xyz, movements, &avg_energy_out, NULL, NULL);
	lavie_data->hr_rr.numMov5s = num_moves;
	lavie_data->hr_rr.seizure = false;
	if(seizure_checking(movements, num_moves) == true)
	{
		lavie_data->hr_rr.seizure = true;
		return;
	}
		
	pnp_data_table_t pnp_opti_xz;	
	bool good_found_xz = false, flag_lowsig_xz = false;
	uint16_t opti_loc_xz = 0;
#ifdef PAD_3_SENSOR
	if(alpha_x1 == 0 && alpha_y1 == 0 && alpha_z1 == 0 && alpha_y2 == 0 && alpha_x2 == 0 && alpha_z2 == 0 && alpha_x3 == 0 && alpha_y3 == 0 && alpha_z3 == 0)
	{
		alpha_x1 = 1;
		alpha_y1 = 1;
		alpha_z1 = 1;
		alpha_x2 = 1;
		alpha_y2 = 1;
		alpha_z2 = 1;
		alpha_x3 = 1;
		alpha_y3 = 1;
		alpha_z3 = 1;
	}
#else
	if(alpha_x1 == 0 && alpha_y1 == 0 && alpha_z1 == 0)
	{
		alpha_x1 = 1;
		alpha_y1 = 1;
		alpha_z1 = 1;
	}
#endif

	// use sum_data_bpf to save memory
	for(uint16_t k = 0; k < HEART_WINDOW; k++)
	{
#ifdef PAD_3_SENSOR
		sum_data_bpf[k] = sq_data->x1[k]*alpha_x1 + sq_data->y1[k]*alpha_y1 + sq_data->z1[k]*alpha_z1 + sq_data->x2[k]*alpha_x2 + sq_data->y2[k]*alpha_y2
		+ sq_data->z2[k]*alpha_z2 + sq_data->x3[k]*alpha_x3 + sq_data->y3[k]*alpha_y3 + sq_data->z3[k]*alpha_z3;
#else
		sum_data_bpf[k] = sq_data->x1[k]*alpha_x1 + sq_data->y1[k]*alpha_y1 + sq_data->z1[k]*alpha_z1;
#endif
	}		
	pnp(sum_data_bpf, HEART_WINDOW, avgsq_noise_xyz, true, &pnp_opti_xz, &opti_loc_xz, &good_found_xz,  &flag_lowsig_xz);
	LOG_DEBUGF("sq_xz- good: %d, lowsig : %d, location: %d, np_ratio: %f",
	good_found_xz, flag_lowsig_xz, opti_loc_xz, pnp_opti_xz.np_ratio); 
	
	bool emer = lifeline_heart(sum_data_bpf, HEART_WINDOW, movements, num_moves, pnp_opti_xz.th_adapt, noise_dft, avgsq_noise_xyz, instant_data->occupied, lavie_data, good_found_xz);
	LOG_DEBUGF("--------> Heart stopping %d", emer);
	if(good_found_xz == false)
	{
		if(lavie_data->hr_rr.instant_hr != ERROR_CASE && lavie_data->hr_rr.instant_hr != PREVIOUS_CASE)
		{
			lavie_data->hr_rr.instant_hr = WEAK_CASE;
		}
	}
	
//	static bool pre_hr_flag[4] = {false, false, false, false};
//	pre_hr_flag[0] = pre_hr_flag[1];
//	pre_hr_flag[1] = pre_hr_flag[2];
//	pre_hr_flag[2] = pre_hr_flag[3];
//	if(lavie_data->hr_rr.instant_hr > 45 && lavie_data->hr_rr.instant_hr < 200)
//	{
//		pre_hr_flag[3] = true;
//	}
//	else{
//		pre_hr_flag[3] = false;
//	}
	
	// free memory
	vPortFree(sq_data); // free pointer sq_data
	vPortFree(sum_data_bpf); // free pointer sum_data_bpf	
}

static uint8_t movArray[DECISION_TIME_SEIZURE+MAX_MOV_5s_NUM];
static bool seizure_checking(movements_t *movements, uint8_t num_movs)
{		
	SeizureVolume_t SeizureVolume = get_seizure_setting();
	uint8_t numDetermine = 0;
	if(SeizureVolume == SEIZURE_NONE)
	{
		return false;
	}
	else if(SeizureVolume == SEIZURE_HIGH){
		numDetermine = 15;
	}
	else if(SeizureVolume == SEIZURE_MEDIUM){
		numDetermine = 20;
	}
	else{
		numDetermine = 25;
	}


//	printf("sizeof seizure_detect %d\r\n", sizeof(seizure_detect));
	memcpy(movArray, &movArray[MAX_MOV_5s_NUM], DECISION_TIME_SEIZURE);
	
	uint8_t index = 0;
	
	for(uint16_t i = 0; i < MAX_MOV_5s_NUM; i++)
	{
		movArray[DECISION_TIME_SEIZURE+i] = 0;
	}	
	
	for(uint16_t i = 0; i < num_movs; i++)
	{
		if(movements[i].loc_end != 0) // have movement
		{
			index = movements[i].loc_end/WINDOW_SIZE_MOV - 1;
			if(index <= MAX_MOV_5s_NUM)
			{
				movArray[DECISION_TIME_SEIZURE + index] = 1;
			}
			else
			{
				LOG_DEBUGF("ERROR: error movements %d!!", index);
			}
		}
	}
	uint8_t count_seizure = 0;
	for(uint16_t i = 0; i < (DECISION_TIME_SEIZURE+MAX_MOV_5s_NUM); i++)
	{
		//LOG_DEBUGF("%d", seizure_detect[i]);
        if(movArray[i] == 1)
        {
            count_seizure++;
        }
        else
        {
            count_seizure = 0;
        }
	}
	if(count_seizure >= numDetermine)
	{
	    memset(movArray, 0, DECISION_TIME_SEIZURE+MAX_MOV_5s_NUM);
	    return true;
	}
	return false;		
}

void SeizureReset()
{
	memset(movArray, 0, sizeof(movArray));
}
